import { NavLink } from "react-router-dom";

export const NotFoundHtml = () => {
  return (
    <React.Fragment>
      <h1>Pagina no encontrada</h1>
      <NavLink to={"/"}>Dar Click aqui para regresar</NavLink>
    </React.Fragment>
  );
};
